Expression macros do not begin with %, and cannot replace instructions. Instead, expression macros can take the place of labels or numeric literals. For example: # extern crate etk_asm;
# let src = r#"
push4 selector("_burn(address,bytes32,uint256)")
# "#;
# let mut output = Vec::new();
# let mut ingest = etk_asm::ingest::Ingest::new(&mut output);
# ingest.ingest(file!(), src).unwrap();
# assert_eq!(output, &[0x63, 0x63, 0x93, 0x63, 0x27]); Here, selector(...) is an expression macro that expands to 0x63936327. The fully expanded source would look like: push4 0x63936327

